class Usuario:    __correo: str = None    __nombre: str = None    __apellido: str = None    __clave: str = None    __fecha: str = None        def __init__(self, correo: str, nombre: str, apellido: str, clave: str, fecha: str) -> None:        self.__correo = correo        self.__nombre = nombre        self.__apellido = apellido        self.__clave = clave        self.__fecha = fecha    def get_correo(self) -> str:        return self.__correo        def get_nombre(self) -> str:        return self.__nombre        def get_apellido(self) -> str:        return self.__apellido    def get_clave(self) -> str:        return self.__clave        def get_fecha(self) -> str:        return self.__fecha        def set_correo(self, correo: str) -> None:        self.__correo = correo        def set_nombre(self, nombre: str) -> None:        self.__nombre = nombre            def set_apellido(self, apellido: str) -> None:        self.__apellido = apellido            def set_clave(self, clave: str) -> None:        self.__clave = clave            def set_fecha(self, fecha: str) -> None:        self.__fecha = fecha